description:
The Escort (James Avalon, Sweet Sinner / 2013)

Amanda, Martin's very unhappy wife wants out of their marriage and fast. The only problem is that she signed a prenuptial agreement and would be left with nothing. Mind you James, Amanda's secret lover, found a huge loop hole in the prenuptial stating in case of infidelity that Amanda would get half of everything. Amanda and James put their plan in action to try and get Martin caught having sex with an escort. Will this devious plan work? Or will Martin see right through it?

Dana DeArmond, Presley Hart, Chanel Preston, Mr. Pete, Chad Alva, James Deen, Evan Stone

